import React from 'react';
import ReactDOM from 'react-dom';
import $ from 'jquery';

// Attach jQuery to the window object
window.$ = window.jQuery = $;

// CSS imports
import './css/bootstrap.css';
import './css/font-awesome.css';
import './css/owl.carousel.css';
import './css/jquery.fancybox.css';
import './css/flexslider.css';
import './css/main.css';
import './css/indent.css';

// JS imports

import './js/cws_parallax.js';
import './js/jquery.fancybox.pack.js';
import './js/jquery.fancybox-media.js';
;
import './js/script.js';
import './js/jquery.tweet.js';

import './js/jquery.flexslider.js';
import './js/retina.min.js';

// Include any other local scripts if needed

function App() {
  return (
    <div>
      {/* Your React components here */}
    </div>
  );
}

ReactDOM.render(<App />, document.getElementById('root'));
